// Somewhat arbitrary numbers. Need to be somewhat adjusted to align with normal font letter spacing...
const defaultLeftSideBearing = 107;
const defaultRightSideBearing = 165;
const fontUnitToGridUnitDivisor = 356;

function getGridUnitWidth(width) {
  return (width - defaultLeftSideBearing - defaultRightSideBearing) / fontUnitToGridUnitDivisor;
}

function getGridUnitKerningRule(kerning) {
  return kerning / fontUnitToGridUnitDivisor;
}

function precision(pathString, decimals = 7) {
  return pathString.replace(/-?\d+\.?\d*/g, match => 
    parseFloat(parseFloat(match).toFixed(decimals)).toString()
  );
}

